// ==UserScript==
// @name         TrollIsAllImages
// @version      0.1
// @description  Troll script to replace all images.
// @author       mblithium
// @match        *
// @run-at       document-start
// ==/UserScript==

/* 

This script is for pranking a friend, set this active in min or any extension that runs userscripts and all images will be replaced with a trollface.

*/

(function() { 
    'use strict'; 
    /* how many updates until it stops running. [counter, max] */
    const repeat = [0, 30];

    /* 

    Image (trollface) converted to base64 - No external load. 
    (change the value from here to another image url to use any image of your choice)

    */
    const imageReplaced = `
    data:image/svg+xml;base64,
    `;

    function addTrolls() {

        const AllImages = document.images;
        const allImagesLength = document.images.length;

        for (let x = 0; x <= allImagesLength; x++) {

            if (AllImages[x] !== imageReplaced) {

                AllImages[x].src = imageReplaced;

            };

        };

    };

    function counterRepeat() {
        repeat[0] = repeat[0] + 1;
        if (repeat[0] >= repeat[1]) { clearInterval(trollInterval); };
    };

    const trollInterval = window.setInterval(
        addTrolls
    ,2000);
    

})();

/* For more information: https://github.com/minbrowser/min/wiki/userscripts */